        return new Source("{% extends 'base.html.twig' %}

{% block title %} Inscription {% endblock %}

{% block body %}

    <div class=\"container\">
        <h1 class=\"my-4\">Inscrivez vous sur notre site !</h1>
        {{ form_start(form) }} <!--start formulaire-->
        <div class=\"row\">
            <div class=\"col\">
                <div class=\"alert alert-light\">
                    <h2 class=\"alert-heading\">Information generales</h2>
                    <hr>
                    {{ form_row(form.firstName) }}
                    {{ form_row(form.lastName) }}
                    {{ form_row(form.email) }}
                    {{ form_row(form.picture) }}
                </div>
                <div class=\"alert alert-light\">
                    <h2 class=\"alert-heading\">Mot de pase</h2>
                    <hr>
                    {{ form_row(form.hash) }}
                    {{ form_row(form.passwordConfirm) }}
                </div>
            </div>
            <div class=\"col\">
                <div class=\"alert alert-light\">
                    <h2 class=\"alert-heading\">Details</h2>
                    <hr>
                    {{ form_row(form.introduction) }}
                    {{ form_row(form.description) }}

                    <hr>
                    <p>Vous y etes presque, confirmez votre inscription et rejoignez nous !</p>
                    <button type=\"submit\" class=\"btn btn-success\">
                        <i class=\"fa fa-check\"></i>
                        Confirmez l'inscription
                    </button>
                </div>
            </div>
        </div>
        {{ form_end(form) }} <!--la fin de formulaire-->
    </div>

{% endblock %}", "account/registration.html.twig", "C:\\xampp\\htdocs\\Sk-Booking\\templates\\account\\registration.html.twig");
